import React from 'react'
import styled from 'styled-components'

const Wrapper = styled.div`
 position: fixed;
 top: 0;
 left: 0;
 right: 0;
 bottom: 0;
 background: rgba(0, 0, 0, 0.6);
 display: flex; 
 align-items: center; 
 justify-content: center;
 color: white;
 #modal{
  background: white;
 }
`

const Modal = ({modalMovie}) => {
 console.log(modalMovie)
 return (
  <Wrapper>
   <img src={modalMovie.poster} alt="" />
   <p>{modalMovie.title}</p>
  </Wrapper>
 )
}

export default Modal
